import React from "react";
import {render} from "react-dom";
import {BrowserRouter, Route, Routes, Link} from "react-router-dom";
import Navbar from "./Navbar.js";
import Home from "./Home.js";
import About from "./About.js";
import Products from "./Products.js";
import Cart from "./Cart.js";

function App() {
  return (<><BrowserRouter>
    <Navbar />
    <Routes><>
      <Route exact path="/" element={<div class="container"><Home/></div>} />
      <Route exact path="/about" element={<div class="container"><About/></div>} />
      <Route exact path="/products" element={<div class="container"><Products/></div>} />
      <Route exact path="/cart" element={<div class="container"><Cart/></div>} />
    </></Routes>
  </BrowserRouter></>);
}

render(<App />, document.getElementById("root"));
